import React from 'react';
import logo from './logo.svg';
import './App.css';

class App extends React.Component {

  render(){
    return (
      <div className="App">
        <header className="App-header">
          Who Wants to Be a Millionaire?
          <img src={logo} className="App-logo" alt="logo" />
        </header>



      </div>
    )
  }


}

export default App;
